import React from "react";

import { increment } from "../redux/slices/cartSlice";

const Counter = () => {

  return (
    <div className="h-[800px] pt-[200px]">
      <h2>Counter: </h2>
      <button onClick={() => increment()}>Increment</button>
    </div>
  );
};

export default Counter;
